  return (
    <div className='hero-container'>
      <video src='/videos/bgvideo.mp4' autoPlay loop muted />
      <h1>ADVE WITH US</h1>
      <p>Start Your Trip Now!</p>
    </div>
  );
}

export default HeroSection;
